import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import HomePage from './components/HomePage';
import UserLogin from './components/UserLogin';
import ManufacturerLogin from './components/ManufacturerLogin';
import DistributorLogin from './components/DistributorLogin';
import PrivateRoute from './components/PrivateRoute';

function App() {
  return (
    <Router>
      <div>
        <Routes>
          {/* Public Route: Home Page */}
          <Route path="/" element={<HomePage />} />

          {/* Public Routes for Login Pages */}
          <Route path="/user-login" element={<UserLogin />} />
          <Route path="/manufacturer-login" element={<ManufacturerLogin />} />
          <Route path="/distributor-login" element={<DistributorLogin />} />

          {/* Add private routes for the dashboards here */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
